import React from "react";
import Header from "../../components/common/Header/Header";
import homeImage from "../../assets/images/home.png"; // Import the image correctly

const HomePage: React.FC = () => {
  return (
    <div className="h-screen flex">
      {/* Left Column - Image */}
      <div className="w-1/2 relative">
        <img
          src={homeImage}
          alt="Logistics Services"
          className="w-full h-full object-cover"
        />
      </div>

      {/* Right Column - Header and Buttons */}
      <div className="w-1/2 flex flex-col">
        {/* Header at the top */}
        <Header />

        {/* Content area with buttons */}
        <div className="flex-grow flex flex-col items-center justify-center p-8">
          <h1 className="text-3xl font-bold mb-10 text-center">Welcome to TuCarga</h1>

          <div className="space-y-6 w-full max-w-xs">
            <button className="w-full bg-primary hover:bg-opacity-90 text-black font-bold py-3 px-6 rounded-md">
              Get Started
            </button>

            <button className="w-full border border-gray-400 hover:border-gray-600 text-gray-800 font-bold py-3 px-6 rounded-md">
              Learn More
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
